import React, { useState, useEffect} from 'react';

function Form () {
    const [message, setMessage] = useState("");

    useEffect(() => {
        fetch('/couriers')
            .then(response => response.text())
            .then(message => {
                setMessage(message);
            });
    },[])

    return (
        <div>
            {message}
        </div>
    );
}

export default Form;
